import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./componentes/home.jsx";
import User from "./componentes/user.jsx";

function App() {
  return (

    <Router>
      <Routes>
        <Route path="/" element={<Home/>} />
        <Route path="/user" element={<User/>} />
      </Routes>
    </Router>
    
  );
}

export default App;
